import React, { Component } from "react";

export default class ChartFlow extends Component {

    constructor(props) {
        super(props)
    }
  render() {
    return (
      <div className="col-md-6  col-xl-3">
        <div className="card-box mb-0 widget-chart-two">
          <div className="float-right">
            <input
              dataPlugin="knob"
              dataWidth="80"
              dataHeight="80"
              dataLinecap="round"
              dataFgColor="#f9bc0b"
              value="92"
              dataSkin="tron"
              dataAngleOffset="180"
              dataReadOnly="true"
              dataThickness=".1"
            />
          </div>
          <div className="widget-chart-two-content">
            <p className="text-muted mb-0 mt-2">{props.title}</p>
            <h3 className="">${props.value}</h3>
          </div>
        </div>
      </div>
    );
  }
}
